import React,{Component} from 'react';
import Post from "./Post";
export default class Posts extends Component{
    render() {
        return(
            <div className="left">
                <Post src="https://i.pinimg.com/originals/0c/3b/3a/0c3b3adb1a7530892e55ef36d3be6cb8.png"  
                alt="usr"/>
            </div>
        )
    }
}
